import React, { Component } from 'react';

export default class Codings extends Component {

  render() {
    return (
      <div className="codings">
        <div> <h3>Projects</h3> </div>
        <div> Project A </div>
        <div> Project B </div>
        <div> Project C </div>
        <div> Project D </div>
      </div>
    );
  }
}
